/*eslint-disable */
import React, { Component } from "react"
import { connect } from "react-redux"
import { Link, withRouter } from "react-router-dom"
import { Button, Grid, Header } from "semantic-ui-react"

import Waveform from "./Waveform"

class SongFeedComponent extends Component {
  state = {}

  render() {
    // ! Need current song with data
    const { songData: {song: {user}} } = this.props
    console.log(song, user)
    return (
      <Grid>
        <div className={`song-comp-${songData.id}`}>
          <Link to='profile'>{songData.song.title}</Link>
          <h1>{songData.song.user.username}</h1>
          <h2>{songData.song.genre}</h2>
          <h3>{songData.song.description}</h3>
          <Waveform
            song_link={songData.song_link}
            waveHeight={100}
            responsive={true}
            splitChannels={false}
            mediaControls={false}
            maxCanvasWidth={10}
          />
        </div>
      </Grid>
    )
  }
}

const mapStateToProps = state => {
  return {
    user: state.user
    // allUsers: state.allUsers,
    // allSongs: state.allSongs
  }
}

export default connect(
  mapStateToProps,
  // null,
  null
)(withRouter(SongFeedComponent))
